INSERT INTO `news` (`id`, `judul`, `tanggal`, `author`, `isi`, `kategori`, `views`) VALUES
(35, 'CARA BELANJA', '2014-01-03 11:22:00', 'admin', '<p style=\"text-align:justify\">Berikut adalah prosedur belanja di toko kami, mohon dibaca dengan teliti dan jelas, sehingga tidak ada pihak yang merasa dirugikan karena tidak faham dengan prosedur yang ada, dan apabila ada ketentuan yang kurang jelas, bisa ditanyakan langsung ke customer service kami,,</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">1.Silahkan pilih barang yang anda butuhkan, anda bisa menemukan barang yang anda maksud dengan mengklik menu daftar barang, atau mencari berdasarkan kategori atau berdasarkan nama pada kolom cari yang sudah disediakan.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">2.Jika barang yang anda maksud sudah ditemukan, silahkan anda menentukan pilihan, apakah langsung menambahkan ke dalam keranjang belanja, atau melihat detail dari barang tersebut, dimana didalam detail akan diapaprkan deskripsi barang, mulai dari stok yang tersedia, jenis barang, bahan dasar, serta penjelasan secara lebih rinci.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">3.Jika sudah yakin dengan pilihan anda, silahkan klik menu keranjang untuk melihat detail belanja anda, jika anda ingin menambah jumlah item barang yang anda maksud silahkan ubah angka yang ada di texbox dengan jumlah yang anda inginkan dan kemudian klik button update untuk memperbaharui data belanjaan anda, dengan catatan tidak melebihi stok yang ada.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">4.Jika anda masih ingin belanja barang yang lain anda bisa mengklik button lanjutkan belanja, atau jika sudah yakin dan tidak ingin berbelanja lagi, silahkan klik button selesai belanja untuk proses pengisian data anda.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">5.Silahkan isi data lengkap anda sesuai dengan yang diminta, dan jika sudah yakin data anda benar, silahkan klik button krirm untuk melanjutkan pesanan anda ke customer service kami, dan disaat bersamaan juga anda akan mendapatkan feedback dari kami berupa detail keseluruhan belanja beserta kode transaksi anda, silahkan catat kode transaksi yang diberikan oleh pihak kami, dan &nbsp;kode ini penting untuk memproses transaksi anda selanjutnya.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">6.Setelah anda melakukan transfer sesuai jumlah yang ditentukan dan kemudian mengkonfirmasi pembayaran anda ke pada pihak kami, lengkap dengan bukti transfer yang anda miliki, bukti yang otentik yang kami minta adalah capture dari bukti pembayaran anda ke rekening kami, baik melalui sms banking, ATM, internet banking atau bentuk lainnya.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">7.Barang yang anda minta akan segera kami proses 1x24 jam setelah anda mengikuti semua prosedur yang kami minta, jika dalam waktu 3x 24 jam anda tidak melakukan konfirmasi pembayaran, pesanan anda kami anggap dibatalkan,</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Dengan membaca ketentuan ini diharapkan anda sudah faham dan menyetujui ketentuan yang telah kami terapkan, terima kasih</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Salam Hormat Kami</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><strong>PAHMI RITONGA</strong></p>\r\n', 'Tips', 556);
