(129, 'Microsoft', 'Microsoft Windows Server ', '<p>Microsoft Windows Server Standart 2012 x64 ENG 1pk DSP OEI DVD 2CPU/2VM</p>\r\n', 11663750, '35', 91),
(130, 'Polycom', 'Polycom Soundstation 2W E', '<p>Layar<br />\r\n132 x 65 pixel backlit graphical LCD<br />\r\nKeypad<br />\r\n12-key telephone keypad<br />\r\nConnection<br />\r\nFour foot cable with standard 2.5mm headset plugs<br />\r\nLoudspeaker<br />\r\nFrequency response: 300 to 3300 Hz &nbsp;<br />\r\nVolume: adjustable to 94 dBA SPL (peak) volume at 0.5 meters<br />\r\nPower Requirement<br />\r\n110V 60Hz AC / 220V 50 Hz AC<br />\r\nLain-Lain<br />\r\n&nbsp;Wireless Capability:<br />\r\nWireless protocol &ndash; 2.4 GHz WDCT Digital Spread Spectrum with Frequency Hopping &nbsp;<br />\r\nSignal range &ndash; 150 feet from base station<br />\r\nDimensi<br />\r\n14.5 x 12.25 x 2.5 in (L x W x H)<br />\r\nBerat<br />\r\n1.90 lb. (0.86 kg) (without battery)</p>\r\n', 15849370, '35', 334),
(132, 'Printer', 'HP Deskjet Ink Advantage ', '<p>Platform&nbsp;&nbsp; &nbsp;Multifunction&nbsp;<br />\r\nMetode Cetak&nbsp;&nbsp; &nbsp;Thermal&nbsp;<br />\r\nTeknologi Cetak&nbsp;&nbsp; &nbsp;HP Thermal Inkjet&nbsp;<br />\r\nMaks. Besaran Kertas&nbsp;&nbsp; &nbsp;A4&nbsp;<br />\r\nMaks. Resolusi&nbsp;&nbsp; &nbsp;4800&nbsp;<br />\r\nEffective Print Resolution&nbsp;&nbsp; &nbsp;4800 x 1200 dpi&nbsp;<br />\r\nKecepatan Cetak B/W&nbsp;&nbsp; &nbsp;20 ppm&nbsp;<br />\r\nKecepatan Cetak Warna&nbsp;&nbsp; &nbsp;16 ppm ppm&nbsp;<br />\r\nMonthly Usage Volume&nbsp;&nbsp; &nbsp;Up to 1000 pages&nbsp;<br />\r\nKonektivitas&nbsp;&nbsp; &nbsp;USB, Wireless&nbsp;<br />\r\nKesesuaian Sistem Operasi&nbsp;&nbsp; &nbsp;Windows 8, Windows 7, Windows Vista, Windows XP SP3 or higher (32-bit only); Mac OS X v10.6, Lion, Mountain Lion&nbsp;<br />\r\nMemori Standar&nbsp;&nbsp; &nbsp;Integrated&nbsp;<br />\r\nInput Tray #1&nbsp;&nbsp; &nbsp;60-sheet input tray&nbsp;<br />\r\nInput Tray #2&nbsp;&nbsp; &nbsp;25-sheet output tray&nbsp;<br />\r\nCompatible Media Sizes&nbsp;&nbsp; &nbsp;<br />\r\nA4; B5; A5; A6; DL envelope &nbsp;<br />\r\nLetter; legal; 4 x 6 in; 5 x 7 in; 8 x 10 in; No. 10 envelopes &nbsp;<br />\r\n&nbsp;<br />\r\nDuplex Printing&nbsp;&nbsp; &nbsp;Manual&nbsp;<br />\r\nCopier Function&nbsp;&nbsp; &nbsp;<br />\r\nSpeed<br />\r\nBlack: Up to 4.5 cpm (draft, A4); Up to 4.5 cpm (laser-comparable) &nbsp;<br />\r\nColour: Up to 3 cpm (draft, A4); Up to 3 cpm (laser-comparable) &nbsp;<br />\r\n&nbsp;<br />\r\nResolution<br />\r\nBlack (text and graphics): Up to 600 x 300 dpi; &nbsp;<br />\r\nColour (text and graphics): Up to 600 x 300 dpi &nbsp;<br />\r\n&nbsp;<br />\r\nMax copies : Up to 9 copies &nbsp;<br />\r\n&nbsp;<br />\r\nScanner Function&nbsp;&nbsp; &nbsp;<br />\r\nScanner type : Flatbed &nbsp;<br />\r\nScan file format : JPEG, TIFF, PDF, BMP, PNG &nbsp;<br />\r\nScan resolution, optical : Up to 1200 dpi &nbsp;<br />\r\nBit depth : 24-bit &nbsp;<br />\r\nScan size (flatbed), maximum : 216 x 297 mm &nbsp;<br />\r\n&nbsp;<br />\r\nPower Consumption&nbsp;&nbsp; &nbsp;10 watts maximum, 10 watts (Active), 0.2 watts (Off), 2.0 watts (Standby),0.9 watt (Sleep)&nbsp;<br />\r\nDimensi&nbsp;&nbsp; &nbsp;(W x D x H) : 425 x 306 x 157 mm&nbsp;<br />\r\nBerat&nbsp;&nbsp; &nbsp;3.60 kg (7.94 lb)&nbsp;<br />\r\nConsumables&nbsp;&nbsp; &nbsp;<br />\r\nHP 678 Black Original Ink Advantage Cartridge (CZ107AA) &nbsp;<br />\r\nHP 678 Tri-color Original Ink Advantage Cartridge (CZ108AA) &nbsp;</p>\r\n', 950000, '35', 111),
(133, 'UPS', 'APC BR1200GI', '<p>Form Factor&nbsp;&nbsp; &nbsp;Tower&nbsp;<br />\r\nDaya Keluar&nbsp;&nbsp; &nbsp;1200VA / 720W&nbsp;<br />\r\nVoltase Masuk&nbsp;&nbsp; &nbsp;<br />\r\nNominal Input Voltage 230V &nbsp;<br />\r\nInput voltage range for main operations 176 -294V &nbsp;<br />\r\nInput voltage adjustable range for mains operation 156 - 300V &nbsp;<br />\r\nInput Breaker Capacity 10.0 A &nbsp;<br />\r\nnput Connections (IEC-320 C14 ) &nbsp;<br />\r\n&nbsp;<br />\r\nVoltase Keluar&nbsp;&nbsp; &nbsp;230Vac<br />\r\nWaveform Type : Stepped approximation to a sinewave &nbsp;<br />\r\nOutput Connections :<br />\r\n(5) IEC 320 C13 (Battery Backup) &nbsp;<br />\r\n(5) IEC 320 C13 (Surge Protection) &nbsp;<br />\r\n(2) IEC Jumpers (Battery Backup) &nbsp;<br />\r\n&nbsp;<br />\r\n&nbsp;<br />\r\nSurge Energy Rating&nbsp;&nbsp; &nbsp;441 Joules<br />\r\nFull time multi-pole noise filtering :10% of IEEE surge let-thgouh : zero clamping response time: instantaneous &nbsp;<br />\r\n&nbsp;<br />\r\nDataline Protection&nbsp;&nbsp; &nbsp;Analog phone line for phone/fax/modem/DSL (RJ-11 connector),Network line - 10/100/1000 Base-T Ethernet (RJ-45 connector)&nbsp;<br />\r\nBack-Up Time Half Load&nbsp;&nbsp; &nbsp;19.9 Minutes&nbsp;<br />\r\nBack-Up Time Full Load&nbsp;&nbsp; &nbsp;7.6 Minutes&nbsp;<br />\r\nAntarmuka / Interface&nbsp;&nbsp; &nbsp;DB-9 RS-232, USB&nbsp;<br />\r\nBaterai&nbsp;&nbsp; &nbsp;<br />\r\nBattery Type Maintenance-free sealed Lead-Acid battery with suspended electrolyte : leakproof &nbsp;<br />\r\nTypical recharge time 8 hour(s) &nbsp;<br />\r\nReplacement Battery APCRBC124 &nbsp;<br />\r\n&nbsp;<br />\r\nDimensi&nbsp;&nbsp; &nbsp;112 x 301 x 380 mm (WxHxD)&nbsp;<br />\r\nBerat&nbsp;&nbsp; &nbsp;11.60 kg&nbsp;<br />\r\nKelengkapan Paket&nbsp;&nbsp; &nbsp;<br />\r\nCD with software &nbsp;<br />\r\nQty 2 - Detachable 2.0 m IEC power cords &nbsp;<br />\r\nTelephone Cable &nbsp;<br />\r\nUSB cable &nbsp;<br />\r\nUser Manual &nbsp;<br />\r\nWarranty card &nbsp;</p>\r\n', 5300000, '35', 168),
