(135, 'Server Dell', 'DELL PowerEdge T20', '<p><br />\r\nPlatform&nbsp;&nbsp; &nbsp;Single CPU Tower Server&nbsp;<br />\r\nProcessor Type&nbsp;&nbsp; &nbsp;Intel Xeon Processor&nbsp;<br />\r\n#1 Processor Onboard&nbsp;&nbsp; &nbsp;Intel&reg; Xeon&reg; Processor E3-1225v3 (8M Cache, 3.20 GHz)&nbsp;<br />\r\nChipset&nbsp;&nbsp; &nbsp;Intel&reg; C226 Chipset&nbsp;<br />\r\nStandard Memory&nbsp;&nbsp; &nbsp;4 GB (1x4GB) DDR3-10600 Unbuffered DIMMs 1333 MHz&nbsp;<br />\r\nMax. Memory&nbsp;&nbsp; &nbsp;32 GB (4 DIMMs)&nbsp;<br />\r\n#1 Controller&nbsp;&nbsp; &nbsp;Intel Rapid Storage Controller 12.0&nbsp;<br />\r\n#1 Hard Drive&nbsp;&nbsp; &nbsp;<br />\r\n1TB HDD SATA &nbsp;<br />\r\n&nbsp;<br />\r\n#1 Optical Drive&nbsp;&nbsp; &nbsp;DVD&plusmn;RW&nbsp;<br />\r\nStandard Bays&nbsp;&nbsp; &nbsp;<br />\r\nUp to four 3.5&rdquo; SATA hard drives &nbsp;<br />\r\nUp to two 2.5&rdquo; SATA hard drives (require expansion kits) with optional controller card &nbsp;<br />\r\n&nbsp;<br />\r\nNetworking&nbsp;&nbsp; &nbsp;Integrated 10/100/1000 Ethernet&nbsp;<br />\r\nChassis Form Factor&nbsp;&nbsp; &nbsp;Tower Chassis&nbsp;<br />\r\nPower Supply Type&nbsp;&nbsp; &nbsp;<br />\r\n290W &nbsp;<br />\r\n&nbsp;<br />\r\nKeyboard Type&nbsp;&nbsp; &nbsp;<br />\r\nDELL Keyboard &nbsp;<br />\r\n&nbsp;<br />\r\nInput Device Type&nbsp;&nbsp; &nbsp;<br />\r\nDELL Mouse &nbsp;<br />\r\n&nbsp;<br />\r\nMonitor&nbsp;&nbsp; &nbsp;Optional&nbsp;<br />\r\nO/S Provided&nbsp;&nbsp; &nbsp;Pre-sales Request Available&nbsp;<br />\r\nValidated System&nbsp;&nbsp; &nbsp;<br />\r\nWindow Server 2008 R2, 2012, 2012 R2, RedHat 6.5 &nbsp;<br />\r\n&nbsp;<br />\r\nStandard Warranty&nbsp;&nbsp; &nbsp;3-Years Warranty by IBM Indonesia (3-Years Next Bussiness Day Parts Replacement, 3-Years Labor, 3-Years Onsite Support)&nbsp;</p>\r\n', 11200000, '35', 107),
